 ('20', '27', 'en_us', NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'c3x2', '', '', '', NULL, '1', '##Your Live Wires playground\r\n\r\n<p class=\"lead\">Today we stop making trash and, instead, start building living, breathing beauties that will look and act the way they were imagined.</p>\r\n\r\nGood stuff! Youâ€™ve downloaded and set up Live Wires successfully on your machine. Here\'s how it works:\r\n\r\nLive Wires is a platform-agnostic design framework made with Sass that allows you to create responsive grey-box wireframes and prototypes in HTML & SCSS. You can keep all your code without needing to create static mock ups or other deliverables you end up throwing away.', 'transparent', NULL, 'standard', 'leftBottom', NULL, 'left', NULL, 'standardRule', NULL, NULL, 'invisible', '0', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'default', 'normal', NULL, NULL, '0', NULL, '', '', NULL, '2016-05-20 06:08:15', '2016-05-22 02:03:46', '5c0d8709-fff2-4e45-bdab-8cb6dac03dfa'),
 ('21', '28', 'en_us', NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'c3', '', '', '', NULL, '1', '###Recommended workflow\r\n\r\n####Step one\r\n\r\nBegin by creating your low-fidelity wireframes right here. This page will act as the index or home page of your project. Feel free to delete or overwrite the content on this page with your own.\r\n\r\n####Step two\r\n\r\nUse the [linked style guide](/guide/) to style your elements, components, and modules.\r\n\r\n####Step three\r\n\r\nRefine your templates and share with your team or clients as fully-responsive high-fidelity prototypes.', 'transparent', NULL, 'standard', 'leftBottom', NULL, 'left', NULL, 'standardRule', NULL, NULL, 'invisible', '0', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'default', 'normal', NULL, NULL, '0', NULL, '', '', NULL, '2016-05-20 06:08:15', '2016-05-22 02:03:46', '9aa40a09-bb99-4b65-8b93-0eecd4bfd8d1'),
