 ('23', '30', 'en_us', NULL, NULL, NULL, NULL, '', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'c2', '', '', '', NULL, '1', '### Support\r\n \r\nSubmit your bug reports, pull requests, and questions to [GitHub](https://github.com/louderthanten/livewires/issues).', 'transparent', NULL, 'standard', 'leftBottom', NULL, 'left', NULL, 'standardRule', NULL, NULL, 'invisible', '0', NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'default', 'normal', NULL, NULL, '0', NULL, '', '', NULL, '2016-05-20 06:08:15', '2016-05-22 02:03:46', '6b884aa3-3496-4b5c-97cc-a10a2223cd72'),
