 ('17', '2', '1', '1', 'en_us', '1', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Louder Than Ten Editorial System\",\"slug\":\"homepage\",\"postDate\":1431723581,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"3\":\"\",\"106\":{\"new0\":{\"type\":\"row\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"colour\":\"transparent\",\"customColour\":\"#000000\",\"image\":\"\",\"rowType\":\"standard\",\"customClass\":\"\",\"anchorName\":\"\"}},\"new1\":{\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"text\":\"##Your Live Wires playground\\r\\n\\r\\n<p class=\\\"lead\\\">Today we stop making trash and, instead, start building living, breathing beauties that will look and act the way they were imagined.<\\/p>\\r\\n\\r\\nGood stuff! You\\u2019ve downloaded and set up Live Wires successfully on your machine. Here\'s how it works:\\r\\n\\r\\nLive Wires is a platform-agnostic design framework made with Sass that allows you to create responsive grey-box wireframes and prototypes in HTML & SCSS. You can keep all your code without needing to create static mock ups or other deliverables you end up throwing away.\",\"markdown\":\"1\",\"width\":\"c3x2\",\"pushLeft\":\"\",\"pushRight\":\"\",\"float\":\"left\",\"customClass\":\"\"}},\"new2\":{\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"text\":\"###Recommended workflow\\r\\n\\r\\n####Step one\\r\\n\\r\\nBegin by creating your low-fidelity wireframes right here. This page will act as the index or home page of your project. Feel free to delete or overwrite the content on this page with your own.\\r\\n\\r\\n####Step two\\r\\n\\r\\nUse the [linked style guide](\\/guide\\/) to style your elements, components, and modules.\\r\\n\\r\\n####Step three\\r\\n\\r\\nRefine your templates and share with your team or clients as fully-responsive high-fidelity prototypes.\",\"markdown\":\"1\",\"width\":\"c3\",\"pushLeft\":\"\",\"pushRight\":\"\",\"float\":\"left\",\"customClass\":\"\"}},\"new3\":{\"type\":\"row\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"colour\":\"reverse\",\"customColour\":\"#000000\",\"image\":\"\",\"rowType\":\"standard\",\"customClass\":\"\",\"anchorName\":\"\"}},\"new7\":{\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"text\":\"### Support\\r\\n \\r\\nSubmit your bug reports, pull requests, and questions to [GitHub](https:\\/\\/github.com\\/louderthanten\\/livewires\\/issues).\",\"markdown\":\"1\",\"width\":\"c2\",\"pushLeft\":\"\",\"pushRight\":\"\",\"float\":\"left\",\"customClass\":\"\"}},\"new8\":{\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"text\":\"###About\\r\\n\\r\\n[Follow us on Twitter](http:\\/\\/twitter.com\\/louderthanten) and stay tuned for more detailed video how-tos about this design workflow.\\r\\n\\r\\nLive Wires is built by [Louder Than Ten](https:\\/\\/louderthanten.com).\",\"markdown\":\"1\",\"width\":\"full\",\"pushLeft\":\"\",\"pushRight\":\"\",\"float\":\"left\",\"customClass\":\"\"}}},\"55\":\"Louder Than Ten\",\"56\":\" Editorial System\"}}', '2016-05-20 06:08:15', '2016-05-20 06:08:15', 'a68d898f-d341-4a80-aef1-6888bd8b4563'),
